script: |
  super -f text -I q4451.spq | sort > q4451.out

inputs:
  - name: q4451.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN ( col0 * + col1 + + col2 ) AND col0 OR + col2 > - col0 * - cor0.col1;
  - name: tab1

outputs:
  - name: q4451.out
    data: |
